      <div className="col-4">
        <div class="card-deck">
          <div className="card">
              <div className="card-body">1</div>
              <div className="card-img-top" ><img style={{height:"56px", width:'100px'}}src="https://congly.vn/data/news/2020/8/18/208/mv-moi-cua-s-t-son-thach-co-su-gop-mat-cua-ninh-duong-lan-ngoc-va-co-minh-hieu-hinh-anh0229461814.jpg" /></div>
              <div className="card-text">Bài hát 1</div>

          </div>

        </div>
      </div>

    );
  }
}

export default App;
